import React from "react";
import HyperCarPage from "./HyperCarPage";
import SportCarPage from "./SportCarPage";
import MomsCarPage from "./MomsCarPage";
import { Link } from "react-router-dom";
import "../Home.css";

function HomePage() {
  return (
    <div className="tri-card">
      <div className="link-container">
        <img className="image-card" src="https://64.media.tumblr.com/c45df73a7bd539f4c65c7866ae7e080a/baa1a83748cd09f6-63/s640x960/fada4b97ad45e078e4acd0110da856e80f79f064.gif" />
        <Link className= "text" to="/hypercar"> Hyper Cars</Link>
      </div>
      <div className="link-container">
        <img className="image-card" src="https://64.media.tumblr.com/5475f1b5a8033a446b926bd1baf7520e/tumblr_o8mz97ROdj1qaf5eeo3_400.gifv" />
        <Link className= "text" to="/sportycar"> Sport Cars</Link>
      </div>
      <div className="link-container">
        <img className="image-card" src="" />
        <Link className= "text" to="/mommycar"> Mommy's Cars</Link>
      </div>
      <footer className="footer">
        <h1> Welcome to Zroom!</h1>
      </footer>
    </div>
  );
}

export default HomePage;
